import React, { Component } from "react";

export default class UsersList extends Component {
  render() {

    return (

        <div className="table">
          <ul className="heading">
            <li>First Name</li>
            <li>First Name</li>
            <li>First Name</li>

          </ul>
          { this.props.Userdata.map(user=>(
          <ul className="userdata">
            <li>{user.fname}</li>
            <li>{user.lname}</li>
            <li>{user.username}</li>

          </ul>))}



        </div>

    );
  }
}
